  false,\n\t\"url\": null,\n\t\"notes\": \"This environmental contaminants monitoring
  program is designed to assess concentrations, distribution, and biological availability
  of environmental contaminants on Stillwater NWR and to evaluate contaminant effects
  on fish, wildlife, and their habitat. The program represents a joint effort between
  staff of Stillwater NWR and the Nevada Fish and Wildlife Office (NFWO) of the Service.
  Monitoring data will be used to evaluate the effectiveness of water and habitat
  management practices in mitigating existing contamination and to track progress
  toward attaining environmental contaminant goals. This information will, in turn,
  be used to refine water and habitat management on Stillwater NWR.\",\n\t\"license_title\":
